import math

def generate_fibonacci(n):
    if n < 0:
        return []
    fibonacci = []
    for i in range(1, n + 1):
        fibonacci.append(int(1 / math.sqrt(5) * (((1 + math.sqrt(5)) / 2) ** i - ((1 - math.sqrt(5)) / 2) ** i) + 0.5))
    return fibonacci

